contracts/LibDemo.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;
import "./Ext.sol";

contract LibDemo {
    using StrExt for string;
    using ArrayExt for uint[];

    function runnerStr(
        string memory str1,
        string memory str2
    ) public pure returns (bool) {
        // return str1.eq(str2); // использование внешней библиотеки. В строке появился метод eq
        return StrExt.eq(str1, str2); // либо можно эту функцию вызвать из глобального объекта библиотеки
    }

    function inArray(uint[] memory array, uint el) public pure returns (bool) {
        return array.inArray(el);
    }
}

contracts/Ext.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

library StrExt {
    function eq(
        string memory str1,
        string memory str2
    ) public pure returns (bool) {
        return keccak256(abi.encode(str1)) == keccak256(abi.encode(str2));
    }
}

library ArrayExt {
    function inArray(uint[] memory arr, uint el) public pure returns (bool) {
        for (uint i = 0; i < arr.length; i++) {
            if (arr[i] == el) {
                return true;
            }
        }
        return false;
    }
}

